import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the first product card using a unique image alt attribute
    await page.waitForSelector('img[alt="Apple iPhone 15 Pro Max, 256GB, Natural Titanium"]', { timeout: 5000 });

    // Find the first product card's "Add to Cart" button using xpath for the product title and following button
    const addToCartButton = await page.waitForSelector(
      '//h3[contains(@class,"product-title") and contains(text(),"iPhone 15 Pro Max")]/following::button[contains(.,"Add to Cart")][1]',
      { timeout: 5000 }
    );

    // Take screenshot before clicking Add to Cart
    const step2 = path.join(screenshotsDir, 'step_2_before_add_to_cart.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the Add to Cart button
    await addToCartButton.click();

    // Wait for notification to appear (success message)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    const step3 = path.join(screenshotsDir, 'step_3_after_add_to_cart.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract cart count from the cart counter element
    await page.waitForSelector('#cartCount', { timeout: 5000 });
    const cartCount = await page.$eval('#cartCount', el => el.textContent.trim());

    // Extract the notification text
    const notificationText = await page.$eval('.notification.success', el => el.textContent.trim());

    return {
      success: true,
      action: "Added the first product (iPhone 15 Pro Max) to cart and verified cart count and notification.",
      extractedData: {
        cartCount,
        notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
